INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 2.46, 3001, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 12300150, 3, 2, 9, 5, "vo_minigame_1012_result_1082", 2, 1, 0);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 2.94, 3001, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 12300151, 3, 2, 9, 5, "vo_minigame_1012_result_1083", 2, 1, 0);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 4.19, 3001, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 12300152, 7, 2, 9, 5, "vo_minigame_1012_result_1084", 3, 1, 0);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 0.0, 3001, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 12300153, 1, 2, 9, 5, "vo_minigame_1012_result_1085", 3, 1, 0);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 2.63, 3001, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 12300154, 3, 2, 9, 5, "vo_minigame_1012_result_1086", 3, 1, 0);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 5.53, 3001, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 12300155, 3, 2, 4, 1, "vo_minigame_1012_result_1087", 1, 1, 0);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 0.01, 3001, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 12300156, 3, 2, 4, 1, "vo_minigame_1012_result_1088", 1, 3, 9);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 4.15, 3001, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 12300157, 3, 2, 4, 1, "vo_minigame_1012_result_1089", 1, 1, 3);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 0.01, 3001, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 12300158, 9, 2, 4, 1, "vo_minigame_1012_result_1090", 2, 9, 9);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 5.37, 3001, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 12300159, 3, 2, 4, 1, "vo_minigame_1012_result_1091", 2, 1, 0);
