INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 3.63, 3001, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 12300164, 4, 2, 0, 0, "vo_minigame_1012_result_1096", 1, 2, 1);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 4.16, 3001, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 12300165, 6, 2, 0, 0, "vo_minigame_1012_result_1097", 1, 2, 1);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 0.01, 3001, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 12300166, 3, 2, 0, 0, "vo_minigame_1012_result_1098", 1, 3, 6);
