INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 5.32, 3001, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 12300170, 5, 2, 0, 0, "vo_minigame_1012_result_1102", 3, 3, 1);
